import React from "react";
import Carousel from "react-bootstrap/Carousel";

const Carousell = (props) => {
  let carousel = props.shows.map((show) => {
    return (
      <Carousel>
        <Carousel.Item>
          <img className="d-block w-100" src={show.image} alt={show.name} />
          <Carousel.Caption>
            <h3>{show.name}</h3>
            <p>{show.name}</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    );
  });

  return <>{carousel}</>;
};

export default Carousell;
